import React from "react";

const Links = (props) => {
  function handleClick(s) {
    console.log(s);
    props.setedpt(`category/${s}`);
  }
    return(
        <div className="nav-scroller py-1 mb-3 border-bottom">
          <nav className="nav nav-underline justify-content-between">
            <p className="nav-item nav-link link-body-emphasis active" onClick={()=>{handleClick('general')}}>
              Home
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('technology')}}>
              Technology
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('business')}}>
              Business
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('entertainment')}}>
              Entertainment
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('science')}}>
              Science
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('health')}}>
              Health
            </p>
            <p className="nav-item nav-link link-body-emphasis" onClick={()=>{handleClick('sports')}}>
              Sports
            </p>
          </nav>
        </div>
    );
};

export default Links;
